import Vue from 'vue';
import App from './App.vue';
import router from './router';  // ตรวจสอบว่าคุณ import router ถูกต้อง

Vue.config.productionTip = false;

new Vue({
  router,  // ใช้งาน router
  render: h => h(App),
}).$mount('#app');
